import axios from "axios"
import { config } from "./constant"

export const AutoCom = {
    "AutoComList" : []
}

axios.get(config["rootApiIP"] + "/data/tickerList")
    .then(res => {
        AutoCom["AutoComList"] = res.data
    })
    .catch(error => {
        if(error.response.data === "Session expired") window.location.reload()
    })
